import React from "react";

export default class extends React.Component {
    state = {
        movieResults: null,
        tvResults: null,
        searchTerm: "",
        loading: null,
        error: null,
    };
    render() {
        const { movieResults, tvResults, searchTerm, loading, error } = this.state;

    }
}
